const BOX_BORDER = "1px solid #E6E6E6";
const BORDER_RADIUS = "4px";

export default {
    maxWidth: "935px",
    bgColor: "#FAFAFA",
    blackColor: "#262626",
    blueColor: "#3897f0",
    navyColor: "#364152",
    greyColor: "#FAFAFA",
    redColor: "ED4956",
    brownColor: "#B3795D",
    ivoryColor: "#DB937B",
    darkGreyColor: "#999",
    lightGreyColor: "rgb(230,230,230)",
    starColor: "#F2CE5A",
    boxBorder: "1px solid #E6E6E6",
    borderRadius: "4px",
    whiteBox: `border-radius:${BORDER_RADIUS};
               border:${BOX_BORDER};
               background-color:white;
              `
};
